(88478, 2715, 1, 2, NULL, 'Minicycline Capsule is an antibiotic medicine used to treat bacterial infections in your body. It is effective in some infections of the lungs, urinary tract, eyes, and others. It kills bacteria, which helps to improve your symptoms and cure the infection.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88479, 2715, 1, 3, NULL, 'DOXYCYCLINE CAPSULES IP 100 MG (DOC-100) is best taken either 1 hour before or 2 hours after a meal. You should take it regularly at evenly spaced intervals as per the schedule prescribed by your doctor. Taking it at the same time every day will help you to remember to take it. The dose will depend on what you are being treated for, but you should always complete a full course of this antibiotic as prescribed by your doctor. Do not stop taking it until you have finished, even when you feel better. If you stop taking it early, some bacteria may survive and the infection may come back.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88480, 2715, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88481, 2715, 2, 2, NULL, 'Exposure to sunlight, even for short periods of time, may cause skin rash, itching, redness or other discoloration of the skin, or a severe sunburn. When you begin taking this medicine: Stay out of direct sunlight, especially between the hours of 10:00 a.m. and 3:00 p.m., if possible', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88482, 2715, 2, 3, NULL, 'If your symptoms do not improve within a few days, or if they become worse, check with your doctor', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88483, 2715, 2, 4, NULL, 'Using this medicine while you are pregnant can harm your unborn baby. Use an effective form of birth control to keep from getting pregnant. If you think you have become pregnant while using this medicine, tell your doctor right away.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88484, 2715, 2, 5, NULL, 'This medicine may darken the color of your skin, nails, eyes, teeth, gums, or scars. Talk with your doctor if you have any concerns.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
