(88517, 3096, 1, 2, NULL, 'Domperidone + Esomeprazole is a combination of two medicines: Domperidone and Esomeprazole. Domperidone is a prokinetic which works on the upper digestive tract to increase the movement of the stomach and intestines, allowing the food to move more easily through the stomach. Esomeprazole is a proton pump inhibitor (PPI) which works by reducing the amount of acid in the stomach which helps in the relief of acid-related indigestion and heartburn.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
