(88527, 3096, 2, 3, 'Severe diarrhea warning:', 'This drug can cause Clostridium difficile-associated diarrhea. This may result in mild diarrhea or severe inflammation of your colon. Severe reactions can be fatal (cause death). Call your doctor if you have diarrhea while taking this drug', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
