(88564, 2716, 1, 2, NULL, 'Indomethacin 25mg Tablet  helps in relieving moderate pain and reducing fever. It effectively alleviates pain and inflammation in conditions like rheumatoid arthritis, osteoarthritis, gout, and ankylosing spondylitis.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88565, 2716, 1, 3, NULL, 'Indomethacin 25mg Tablet  should be taken in the dose and duration as advised by your doctor. It should be taken with food or milk to prevent stomach upset. Inform your doctor if you have any history of heart disease or stroke', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88566, 2737, 1, 1, NULL, 'Alprazolam is used in the treatment of Anxiety. Alprazolam is a benzodiazepine. It works by increasing the action of a chemical messenger (GABA) which suppresses the abnormal and excessive activity of the nerve cells in the brain.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
