(88568, 2716, 2, 2, NULL, 'Your doctor may recommend monitoring your blood pressure while using this medicine', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88569, 2716, 2, 3, NULL, 'It is very important that your doctor check your progress at regular visits. This will allow your doctor to see if the medicine is working properly and to decide if you should continue to take it. Blood and urine tests may be needed to check for unwanted effects.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
