(88694, 2711, 1, 2, NULL, 'CEPHALEXIN TABLET is an antibiotic medicine that works by killing the infection causing bacteria in your body. It is effective for bacterial infections of the throat, ears, urinary tract, skin, and soft tissues. This medicine usually makes you feel better within a few days, but you should continue taking it as prescribed even when you feel better. Stopping it early may make the infection come back and harder to treat.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88695, 2711, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88696, 2711, 1, 3, NULL, 'CEPHALEXIN TABLET is an antibiotic. It kills bacteria by preventing them from forming the bacterial protective covering (cell wall) which is needed for them to survive.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
(88697, 2711, 2, 2, NULL, 'tell your doctor if you have or have ever had any kind of allergies, gastrointestinal disease (GI; affecting the stomach or intestines), especially colitis (condition that causes swelling in the lining of the colon [large intestine]), or kidney or liver disease.', '2020-12-22 09:01:16', '2020-12-22 09:01:16'),
