(88964, 2868, 1, 2, NULL, 'AMOXICILLIN Oral Suspension is a penicillin-type of antibiotic used to treat a variety of bacterial infections. It is effective in infections of the throat, ear, nasal sinuses, respiratory tract (e.g., pneumonia), urinary tract, skin and soft tissue, and typhoid fever', '2020-12-22 09:01:17', '2020-12-22 09:01:17'),
(88965, 2868, 1, 3, NULL, 'Additionally, AMOXICILLIN Oral Suspension helps to eliminate a bacteria known as H. pylori in people with peptic ulcer disease. It is a broad-spectrum antibiotic that fights and stops the growth of many types of bacteria. This medicine is best taken with a meal to reduce the chance of a stomach upset. You should take it regularly at evenly spaced intervals as per the schedule prescribed by your doctor. Taking it at the same time every day will help you to remember to take it.', '2020-12-22 09:01:17', '2020-12-22 09:01:17'),
