(89183, 2782, 1, 2, NULL, 'ERYTHROMYCIN ESTOLATE  Oral Suspension is an antibiotic used to treat various types of infections. It is effective in most infections of the respiratory tract, ear, nose, throat, lungs, and skin. It stops the bacteria from growing, which helps to resolve the symptoms and cures the infection.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89184, 2782, 1, 3, NULL, 'ERYTHROMYCIN ESTOLATE is taken orally, preferably either one hour before or 2 hours after a meal. It is best absorbed when taken on an empty stomach. It should be used regularly at evenly spaced time intervals as prescribed by your doctor. Do not skip any doses and finish the full course of treatment even if you feel better. Stopping the medicine too early may lead to the infection returning or worsening.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
