(89189, 2722, 1, 3, NULL, 'AMPICILLIN is a penicillin-type of antibiotic used to treat a variety of bacterial infections. It is effective in infections of the throat, ear, nasal sinuses, respiratory tract (e.g., pneumonia), urinary tract, skin and soft tissue, and typhoid fever', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
