(89280, 2782, 2, 2, NULL, 'Before taking erythromycin, tell your doctor or pharmacist if you are allergic to it; or to other macrolide antibiotics (such as azithromycin, clarithromycin); or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems. Talk to your pharmacist for more details.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89281, 2782, 2, 3, NULL, 'Before using this medication, tell your doctor or pharmacist your medical history, especially of: kidney disease, liver disease, a certain type of muscle disease (myasthenia gravis).', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
