(89288, 2782, 2, 4, NULL, 'Erythromycin may cause a condition that affects the heart rhythm (QT prolongation). QT prolongation can rarely cause serious (rarely fatal) fast/irregular heartbeat and other symptoms (such as severe dizziness, fainting) that need medical attention right away.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89289, 2782, 2, 5, NULL, 'Erythromycin may cause live bacterial vaccines (such as typhoid vaccine) to not work as well. Do not have any immunizations/vaccinations while using this medication unless your doctor tells you to.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89290, 2782, 2, 6, NULL, 'Older adults may be more sensitive to the side effects of this drug, especially hearing loss and QT prolongation (see above).', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89291, 2782, 2, 7, NULL, 'Tell your doctor if you are pregnant before using this medication.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89292, 2782, 6, 1, NULL, 'Please inform your doctor if you have recently consumed or are consuming any of the below mention medicine:', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89293, 2782, 6, 2, NULL, 'Many drugs besides erythromycin may affect the heart rhythm (QT prolongation), including amiodarone, dofetilide, cisapride, pimozide, procainamide, propafenone, quinidine, sotalol, among others.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89294, 2782, 6, 3, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89295, 2782, 5, 1, NULL, 'Nausea, vomiting, diarrhea, stomach pain/cramping, and loss of appetite may occur. Taking this medication with food may lessen these symptoms. If any of these effects persist or worsen, tell your doctor or pharmacist promptly.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89296, 2782, 5, 2, NULL, 'Remember that your doctor has prescribed this medication because he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89297, 2782, 5, 3, NULL, 'Tell your doctor right away if you have any serious side effects, including: signs of liver disease (such as persistent nausea/vomiting, yellowing eyes or skin, dark urine, severe stomach/abdominal pain), unusual tiredness, muscle weakness, slurred speech, blurred vision, drooping eyelids, hearing loss.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89298, 2782, 5, 4, NULL, 'Get medical help right away if you have any very serious side effects, including: severe dizziness, fainting, fast/irregular heartbeat.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89299, 2782, 5, 5, NULL, 'Do not use anti-diarrhea or opioid medications if you have any of these symptoms because these products may make them worse.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
(89300, 2782, 5, 6, NULL, 'This is not a complete list of possible side effects. If you notice other effects not listed above, contact your doctor or pharmacist.', '2020-12-22 09:01:18', '2020-12-22 09:01:18'),
