(89989, 2433, 1, 1, NULL, 'The Product is recommended for use to treat the following:', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89990, 2433, 1, 2, NULL, 'CEFIXIME Tablet is an antibiotic belonging to the cephalosporin group, which is used to treat a variety of bacterial infections. It is effective in infections of the respiratory tract (eg. pneumonia), urinary tract, ear, nasal sinus, throat, and some sexually transmitted diseases.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89991, 2433, 1, 3, NULL, 'CEFIXIME  Tablet should be given under the supervision of a doctor or health professional. Use it regularly at evenly spaced intervals as per the schedule prescribed by your doctor. Using it at the same time every day will help you remember to take it. The dose will depend on what you are being treated for, but you should always complete the full course of this antibiotic as prescribed by your doctor. Do not stop taking it until you have finished, even when you feel better. If you stop taking it early, some bacteria may survive and the infection may come back or worsen. It will not work for viral infections such as flu or common cold. Using any antibiotic when you do not need it can make it less effective for future infections.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89992, 2433, 5, 2, NULL, 'severe skin reaction--fever, sore throat, swelling in your face or tongue, burning in your eyes, skin pain followed by a red or purple skin rash that spreads (especially in the face or upper body) and causes blistering and peeling.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89993, 2433, 5, 3, NULL, 'kidney problems--little or no urination, painful or difficult urination, swelling in your feet or ankles, feeling tired or short of breath; or', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89994, 2433, 5, 4, NULL, 'severe stomach pain, diarrhea that is watery or bloody;', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89995, 2433, 5, 5, NULL, 'low blood cell counts--sudden weakness or ill feeling, fever, chills, flu-like symptoms, swollen gums, mouth sores, skin sores, rapid heart rate, pale skin, easy bruising, unusual bleeding, feeling light-headed;', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(89996, 2433, 5, 6, NULL, 'pale or yellowed skin, dark colored urine, confusion or weakness;', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
