(90001, 2433, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90002, 2433, 2, 2, NULL, 'Before taking cefixime, tell your doctor or pharmacist if you are allergic to it; or to penicillins or other cephalosporin antibiotics (e.g., cephalexin); or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems. Talk to your pharmacist for more details.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90003, 2433, 2, 3, NULL, 'Before using this medication, tell your doctor or pharmacist your medical history, especially of: kidney disease, a certain intestinal disease (colitis).', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90004, 2433, 2, 4, NULL, 'This medication should be used only when clearly needed during pregnancy. Discuss the risks and benefits with your doctor.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90005, 2433, 2, 5, NULL, 'It is unknown if this medication passes into breast milk. Consult your doctor before breast-feeding.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90006, 2433, 2, 6, NULL, 'Cefixime may cause live bacterial vaccines (such as typhoid vaccine) to not work as well. Do not have any immunizations/vaccinations while using this medication unless your doctor tells you to.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90007, 2778, 1, 1, NULL, 'The Product is recommended for use to treat trichomoniasis (a sexually transmitted disease that can affect men and women), giardiasis (an infection of the intestine that can cause diarrhea, gas, and stomach cramps), and amebiasis (an infection of the intestine that can cause diarrhea, gas, and stomach cramps and can spread to other organs such as the liver). Tinidazole is also used to treat bacterial vaginosis (an infection caused by an overgrowth of harmful bacteria in the vagina) in women.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90008, 2433, 6, 1, NULL, 'Please inform your doctor if you have recently consumed or are consuming any of the below mention medicine:', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90009, 2433, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90010, 2433, 6, 3, NULL, 'Products that may interact with this drug include: \"blood thinners\" (e.g., warfarin).', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
