(90054, 2827, 6, 2, NULL, 'For example, avoid consuming alcoholic drinks while you take cetirizine. Doing so may be dangerous. Mixing cetirizine with alcohol can cause drowsiness or make you less alert.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
