(90056, 2827, 6, 4, NULL, 'Mixing cetirizine with drugs that depress your central nervous system can increase sleepiness. It can also further affect your mental and nervous system functions.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90057, 2827, 6, 5, NULL, 'There is a possibility of a drug interaction between cetirizine and theophylline. Theophylline (Theo-24) is a drug that some people with asthma and other lung problems take.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90058, 2827, 6, 6, NULL, 'In some instances when the two drugs were taken, it took longer for cetirizine to leave the body. However, the interaction may be dose-related. It has only been reported with daily theophylline doses of 400 mg or more.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
(90059, 2827, 5, 1, NULL, 'Cetirizine is a newer, second-generation antihistamine. Unlike first-generation antihistamines, cetirizine is less likely to cause side effects such as dangerous drowsiness, dry mouth, blurred vision, and overheating.', '2020-12-22 09:01:20', '2020-12-22 09:01:20'),
