(91373, 2732, 2, 3, NULL, 'This medication may cause live bacterial vaccines (such as typhoid vaccine) to not work as well. Do not have any immunizations/vaccinations while using this medication unless your doctor tells you to.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91374, 2732, 2, 4, NULL, 'This medication may make you more sensitive to the sun. Limit your time in the sun. Avoid tanning booths and sunlamps. Use sunscreen and wear protective clothing when outdoors. Get medical help right away if you get sunburned or have skin blisters/redness.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91375, 2732, 2, 5, NULL, 'Older adults may be more sensitive to the side effects of this drug, especially skin reactions, blood disorders, easy bleeding/bruising, and a high potassium blood level.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91376, 2732, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91377, 2732, 6, 3, NULL, 'Some products that may interact with this drug include: \"blood thinners\" (such as warfarin), dofetilide, methenamine, methotrexate.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91378, 2873, 5, 6, NULL, 'black or dark-colored stools or urine;', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91379, 2873, 5, 7, NULL, 'temporary staining of the teeth;', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91380, 2051, 1, 1, NULL, 'The Product is recommended for use to treat the following:', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91381, 2051, 1, 2, NULL, 'It is also used to relieve the symptoms of cold and flu', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91382, 2051, 1, 3, NULL, 'It is used to reduce a fever (high temperature)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91383, 2051, 1, 4, NULL, 'It is used for mild to moderate pain including headache, migraine, nerve pain, toothache, sore throat, period pains and general aches and pains', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91384, 2051, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91385, 2051, 2, 2, NULL, 'Are alcoholic', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91386, 2051, 2, 3, NULL, 'An allergic reaction to Paracetamol or to any of the ingredients in this medicine', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91387, 2051, 2, 4, NULL, 'Have kidney problems', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91388, 2051, 2, 5, NULL, 'Have liver problems', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91389, 2051, 6, 1, NULL, 'Please inform your doctor if you have recently consumed or are consuming any of the below mention medicine:', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91390, 2051, 6, 2, NULL, 'Birth control pils', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91391, 2051, 6, 3, NULL, 'Any other medicines that contain paracetamol', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91392, 2051, 6, 4, NULL, 'Anticonvulsants (used to treat epilepsy or fits)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91393, 2051, 6, 5, NULL, 'Barbiturates', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91394, 2051, 6, 6, NULL, 'Domperidone and metoclopramide (used to treat nausea and vomiting)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91395, 2051, 6, 7, NULL, 'Tricyclic antidepressants (such as amitriptyline)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91396, 2051, 6, 8, NULL, 'Zidovudine (used in HIV infections and AIDS)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91397, 2051, 6, 9, NULL, 'Cholestyramine (used to treat high cholesterol)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91398, 2051, 6, 10, NULL, 'Warfarin (used to thin the blood and prevent clotting)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91399, 2051, 5, 1, 'SERIOUS', 'Severe pain in the abdomen and back, with fever, loss of appetite, nausea and vomiting (these may be signs of pancreas inflammation)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91400, 2051, 5, 2, 'SERIOUS', 'Skin rash, flaking skin, boils, sore lips and mouth, swelling of the face, fever', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91401, 2051, 5, 3, 'SERIOUS', 'Bruising more easily, sore throat or other signs of infection (these may be signs of a blood disorder)', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91402, 2051, 5, 4, 'SERIOUS', 'Sudden wheezing, fluttering or tightness of the chest', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91403, 2051, 5, 5, 'VERY RARE', 'Serious skin reactions', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91404, 2732, 1, 2, NULL, 'To reduce the development of drug-resistant bacteria and maintain the effectiveness of sulfamethoxazole and trimethoprim oral suspension and other antibacterial drugs, sulfamethoxazole and trimethoprim oral suspension should be used only to treat or prevent infections that are proven or strongly suspected to be caused by bacteria.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91405, 2732, 1, 3, NULL, 'This medication is a combination of two antibiotics: sulfamethoxazole and trimethoprim. It is used to treat a wide variety of bacterial infections (such as middle ear, urine, respiratory, and intestinal infections). It is also used to prevent and treat a certain type of pneumonia (pneumocystis-type).', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91406, 2732, 6, 4, NULL, 'This product may interfere with certain laboratory tests, possibly causing false test results. Make sure laboratory personnel and all your doctors know you use this product.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91407, 2732, 5, 1, NULL, 'Nausea, vomiting, diarrhea, and loss of appetite may occur. If any of these effects persist or worsen, tell your doctor or pharmacist promptly.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91408, 2732, 5, 2, NULL, 'Remember that your doctor has prescribed this medication because he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91409, 2732, 5, 3, NULL, 'Tell your doctor right away if you have any serious side effects, including: muscle weakness, mental/mood changes, signs of kidney problems (such as change in the amount of urine, blood in the urine), extreme drowsiness, signs of low blood sugar (such as sudden sweating, shaking, fast heartbeat, hunger, blurred vision, dizziness, or tingling hands/feet).', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91410, 2732, 5, 4, NULL, 'Get medical help right away if you have any very serious side effects, including: persistent headache, neck stiffness, seizures, slow/irregular heartbeat.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91411, 2734, 1, 2, NULL, 'This product is a combination of B vitamins used to treat or prevent vitamin deficiency due to poor diet, certain illnesses, alcoholism, or during pregnancy. Vitamins are important building blocks of the body and help keep you in good health. B vitamins include thiamine, riboflavin, niacin/niacinamide, vitamin B6, vitamin B12, folic acid, and pantothenic acid.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91412, 2734, 1, 3, NULL, 'Some brands of B vitamins also contain ingredients such as vitamin C, vitamin E, biotin, or zinc. Consult your doctor or pharmacist if you have questions about the ingredients in your brand.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91413, 2734, 2, 2, NULL, 'Before taking this product, tell your doctor or pharmacist if you are allergic to any of its ingredients; or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems. Talk to your pharmacist for more details.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91414, 2734, 2, 3, NULL, 'If you have any of the following health problems, consult your doctor or pharmacist before using this product: diabetes, liver problems, vitamin B12 deficiency (pernicious anemia).', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91415, 2734, 2, 4, NULL, 'Liquid forms of this product may contain sugar and/or alcohol. Caution is advised if you have diabetes, alcohol dependence, or liver disease. Ask your doctor or pharmacist about using this product safely.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91416, 2734, 2, 5, NULL, 'This product passes into breast milk. While there have been no reports of harm to nursing infants, consult your doctor before breast-feeding.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91417, 2734, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91418, 2734, 6, 3, NULL, 'Some products that may interact with this drug are: altretamine, cisplatin, certain antibiotics (e.g., chloramphenicol), certain anti-seizure drugs (e.g., phenytoin), levodopa, other vitamin/nutritional supplements.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91419, 2734, 5, 1, NULL, 'Mild upset stomach or flushing may occur. These effects are usually temporary and may disappear as your body adjusts to this product. If any of these effects persist or worsen, contact your doctor or pharmacist promptly.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91420, 2734, 5, 2, NULL, 'If your doctor has directed you to take this medication, remember that he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
(91421, 2734, 5, 3, NULL, 'A very serious allergic reaction to this drug is rare. However, seek immediate medical attention if you notice any symptoms of a serious allergic reaction, including: rash, itching/swelling (especially of the face/tongue/throat), severe dizziness, trouble breathing.', '2020-12-22 09:01:23', '2020-12-22 09:01:23'),
