(92003, 2875, 1, 2, NULL, 'ORS Powder is a WHO based ORS (Oral Rehydration Salt) formula. Oral rehydration salt is a combination of Dextrose and a number of essential electrolytes (Sodium Chloride, Potassium Chloride, Sodium Citrate). ORS Powder restores body fluids & electrolytes, lost due to dehydration in during Diarrhea, vomiting, muscle cramping, and exertional heat illness while exercising in hot or humid weather.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92004, 2875, 2, 2, NULL, 'You are pregnant or breastfeeding. This is because, while you are expecting or feeding a baby, you should only take medicines on the recommendation of a doctor.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92005, 2875, 2, 3, NULL, 'You have any other illnesses, disorders, or medical conditions.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92006, 2875, 2, 4, NULL, 'You are taking any other medicines. This includes any medicines you are taking which are available to buy without a prescription, such as herbal and complementary medicines.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92007, 2875, 1, 3, NULL, 'Restores body fluids & electrolytes, lost due to dehydration in during Diarrhea, vomiting, muscle cramping, and exertional heat illness while exercising in hot or humid weather', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92008, 2875, 1, 4, NULL, 'Helps in the treatment of mild and moderate dehydration with ORS', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92009, 2875, 1, 5, NULL, 'Sodium chloride is utilized by body cells for its normal function', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92010, 2875, 3, 7, NULL, 'Dissolve the contents of the packet in the amount of drinking water indicated on the packet, usually 1 litre', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92011, 2875, 3, 8, NULL, 'Note: Be careful to mix the right amount of water. If you use too little water, the drink could make the diarrhoea worse', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92012, 2875, 3, 9, NULL, 'Stir well, and give to the child to drink in a cup or spoon-feed', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92013, 2875, 3, 10, NULL, 'If drinking water is not available, or if you are not sure the water is drinkable, boil the water for at least 10 minutes and then let cool', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92014, 2875, 2, 5, NULL, 'You have allergy with any of active or inactive ingredients of oral rehydration salts or other medications.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
