(92195, 2045, 6, 3, NULL, 'When two or more medicines are taken together, it can change how the medicines work and increase the risk of side-effects. In medical terms, this is called as a Drug Interaction.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92196, 2045, 6, 4, NULL, 'This page does not contain all the possible interactions of Amoxycillin Tablet. Share a list of all medicines that you use with your doctor and pharmacist. Do not start, stop, or change the dose of any medicines without the approval of your doctor.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92197, 2045, 6, 5, NULL, 'Special instructions need to be followed while taking this medicine along with Sex steroids such as oestriol, which is a female sex hormone. When Amoxycillin is taken by pregnant women, a decrease in the level of estrogens in the blood has been noted.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92198, 2045, 6, 6, NULL, 'Special instructions need to be followed while taking this medicine along with Oral Contraceptives, which are used to prevent pregnancy. When Amoxycillin is used with oral contraceptives, it may effect microorganisms present in the digestive tract. This results in decreased estrogen reabsorption and thus reduces the effectiveness of oral contraceptives.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
(92199, 2045, 6, 7, NULL, 'There may be an interaction of Amoxycillin with Antimetabolites such as methotrexate, which is mainly used to treat cancer. Amoxycillin may reduce the excretion of methotrexate which results in its increased level in the blood', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
