(92201, 2045, 6, 9, NULL, 'Amoxycillin Tablet may interact with Tetracyclines, which are used to treat infections. Tetracyclines and other antibacterial drugs may interfere with the effectiveness of Amoxycillin.', '2020-12-22 09:01:24', '2020-12-22 09:01:24'),
