(92646, 2754, 1, 2, NULL, 'FRUSAMIDE 40 MG TABLET belongs to a group of medicines called diuretics or water tablets. It is used to reduce the swelling (edema) caused by too much water in the body in people who have heart failure, liver or kidney disease. This medicine is also used to treat high blood pressure.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
