(92650, 2754, 1, 3, NULL, 'FRUSAMIDE 40 MG TABLET helps your body get rid of extra water and salt through urine. It may be used alone or in combination with other medicines as per the dose advised by your doctor. It can be taken with or without food and should be taken at the same time each day. It is best to avoid taking this medicine within 4 hours of your bedtime to prevent having to get up at night to urinate.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
