(92690, 2853, 1, 2, NULL, 'ITOPRIDE Tablet is a prescription medicine used to treat nausea, vomiting, and prevent the feeling of fullness during or shortly after a meal. It also treats stomach discomfort, or heartburn caused by the flow of the stomach contents back into your food pipe.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92691, 2853, 1, 3, NULL, 'ITOPRIDE Tablet is taken before meals in a dose and duration as advised by the doctor. The dose you are given will depend on your condition and how you respond to the medicine. You should take this medicine until your doctor tells you to stop. Let your doctor know about all other medications you are taking as some may affect, or be affected by this medicine.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92692, 2853, 1, 4, NULL, 'Latest prescription information about Itopride. Learn how to pronounce the drug\'s name, its indications, dosage, how to take, when to take, when not to take, side effects, special precautions, its storage instructions and warnings if any when taken during pregnancy. Also listed are the International and Indian trade name(s) of the drug and its price list.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92693, 2853, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92694, 2754, 2, 2, NULL, 'Before taking furosemide, tell your doctor or pharmacist if you are allergic to it; or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems. Talk to your pharmacist for more details.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92695, 2754, 2, 3, NULL, 'Before using this medication, tell your doctor or pharmacist your medical history, especially of: kidney problems, liver problems, inability to make urine, gout, lupus.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92696, 2754, 2, 4, NULL, 'If you have diabetes, furosemide may affect your blood sugar. Check your blood sugar regularly as directed and share the results with your doctor. Your doctor may need to adjust your diabetes medication, exercise program, or diet.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92697, 2754, 2, 5, NULL, 'Before having surgery, tell your doctor or dentist about all the products you use (including prescription drugs, nonprescription drugs, and herbal products).', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92698, 2754, 2, 6, NULL, 'Babies born early (premature infants) and children may be more sensitive to certain effects of this drug, such as kidney stones.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92699, 2754, 2, 7, NULL, 'Older adults may be more sensitive to the effects of this drug, especially dizziness and water/mineral loss.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92700, 2754, 2, 8, NULL, 'During pregnancy, this medication should be used only when clearly needed. Discuss the risks and benefits with your doctor.', '2020-12-22 09:01:25', '2020-12-22 09:01:25');
