(92702, 2914, 1, 1, NULL, 'The Product is recommended for use to treat the following:', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92703, 2914, 1, 2, NULL, 'GLIBENCLAMIDE 5mg Tablet is a medicine used to treat type 2 diabetes mellitus in adults. It belongs to a group of medicines called sulfonylureas and helps control blood sugar levels in people with diabetes. This helps to prevent serious complications of diabetes like kidney damage and blindness.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92704, 2914, 1, 3, NULL, 'GLIBENCLAMIDE 5mg Tablet may be used by itself or along with other medicines. It should be taken with food. Take it regularly at the same time each day to get the most benefit. Your doctor will decide what dose is best for you and this may change from time to time according to how it is working.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92705, 2914, 6, 1, NULL, 'Please inform your doctor if you have recently consumed or are consuming any of the below mention medicine:', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92706, 2914, 6, 2, NULL, 'Take the missed dose as soon as you remember with food. However, if it is almost time for the next scheduled dose then the missed dose can be skipped.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
(92707, 2914, 6, 3, NULL, 'Contact a doctor immediately if an overdose is suspected. Symptoms of overdose may include confusion, sweating, weakness, vomiting, fainting, seizures etc.', '2020-12-22 09:01:25', '2020-12-22 09:01:25'),
