(93138, 2900, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:26', '2020-12-22 09:01:26'),
(93139, 2900, 6, 3, NULL, 'A product that may interact with this drug is: ketoconazole.', '2020-12-22 09:01:26', '2020-12-22 09:01:26'),
(93140, 2900, 6, 4, NULL, 'This medication may interfere with certain laboratory tests, possibly causing false test results. Make sure laboratory personnel and all your doctors know you use this drug.', '2020-12-22 09:01:26', '2020-12-22 09:01:26'),
(93141, 2900, 5, 1, NULL, 'This drug usually has no side effects. If you have any unusual effects, contact your doctor or pharmacist promptly.', '2020-12-22 09:01:26', '2020-12-22 09:01:26'),
(93142, 2900, 5, 2, NULL, 'If your doctor has directed you to use this medication, remember that he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:26', '2020-12-22 09:01:26'),
