(93384, 2754, 5, 1, NULL, 'Dizziness, lightheadedness, headache, or blurred vision may occur as your body adjusts to the medication. If any of these effects persist or worsen, tell your doctor or pharmacist promptly.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93385, 2754, 5, 2, NULL, 'To reduce the risk of dizziness and lightheadedness, get up slowly when rising from a sitting or lying position.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93386, 2754, 5, 3, NULL, 'Remember that your doctor has prescribed this medication because he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93387, 2754, 5, 4, NULL, 'Tell your doctor right away if any of these unlikely but serious side effects occur: signs of kidney problems (such as change in the amount of urine), numbness/tingling/pain/redness/swelling of the arms/legs, hearing changes (such as ringing in the ears, temporary or permanent decreased hearing/deafness), stomach/abdominal pain, yellowing eyes/skin.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93388, 2754, 5, 5, NULL, 'This medication may cause a serious loss of body water (dehydration) and salt/minerals. Tell your doctor right away if you have any of these unlikely but serious side effects: muscle cramps, weakness, unusual tiredness, confusion, severe dizziness, fainting, drowsiness, unusual dry mouth/thirst, nausea, vomiting, fast/irregular heartbeat.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93389, 2754, 5, 6, NULL, 'A very serious allergic reaction to this drug is rare. However, get medical help right away if you notice any symptoms of a serious allergic reaction, including: rash, itching/swelling (especially of the face/tongue/throat), severe dizziness, trouble breathing.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
