INSERT INTO `descriptions` (`id`, `product_code`, `description_type_code`, `sr_no`, `heading`, `description`, `created_at`, `updated_at`) VALUES
(93442, 2836, 6, 2, NULL, 'If your doctor has directed you to use this medication, your doctor or pharmacist may already be aware of any possible drug interactions and may be monitoring you for them. Do not start, stop, or change the dosage of any medicine before checking with your doctor, health care provider or pharmacist first.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93443, 2836, 6, 3, NULL, 'apomorphine', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93444, 2836, 6, 4, NULL, 'dronedarone', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93445, 2898, 6, 1, NULL, 'Please inform your doctor if you have recently consumed or are consuming any of the below mention medicine:', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93446, 2898, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93447, 2898, 6, 3, NULL, 'Some products that may interact with this drug include: \"blood thinners\" (such as acenocoumarol, warfarin), strontium.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93448, 2898, 6, 4, NULL, 'Many drugs besides ofloxacin may affect the heart rhythm (QT prolongation), including dofetilide, procainamide, amiodarone, quinidine, sotalol, among others.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93449, 2898, 6, 5, NULL, 'Ofloxacin is very similar to levofloxacin. Do not use medications containing levofloxacin while using ofloxacin.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93450, 2898, 5, 1, NULL, 'Upset stomach, nausea, diarrhea, headache, dizziness, lightheadedness, or trouble sleeping may occur. If any of these effects persist or worsen, tell your doctor or pharmacist promptly.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93451, 2898, 5, 2, NULL, 'Remember that your doctor has prescribed this medication because he or she has judged that the benefit to you is greater than the risk of side effects. Many people using this medication do not have serious side effects.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93452, 2898, 5, 3, NULL, 'Tell your doctor right away if you have any serious side effects, including: easy bruising/bleeding, signs of a new infection (such as new/persistent fever, persistent sore throat), signs of kidney problems (such as change in the amount of urine), signs of liver problems (such as unusual tiredness, stomach/abdominal pain, persistent nausea/vomiting, yellowing eyes/skin, dark urine).', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93453, 2898, 5, 4, NULL, 'Get medical help right away if you have any very serious side effects, including: hearing changes, unsteadiness, severe dizziness, fainting, fast/irregular heartbeat, signs of a tear/break in the main blood vessel called the aorta (sudden/severe pain in the stomach/chest/back, cough, shortness of breath).', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93454, 2898, 5, 5, NULL, 'Do not use anti-diarrhea or opioid medications if you have any of these symptoms because these products may make them worse.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93455, 2898, 5, 6, NULL, 'Use of this medication for prolonged or repeated periods may result in oral thrush or a new yeast infection. Contact your doctor if you notice white patches in your mouth, a change in vaginal discharge, or other new symptoms.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93456, 2898, 5, 7, NULL, 'This is not a complete list of possible side effects. If you notice other effects not listed above, contact your doctor or pharmacist.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
