(93541, 2773, 1, 2, NULL, 'DICLOFENAC  & PARACETAMOL  50 mg/325 mg Tablet is a pain relieving medicine. It is used to reduce pain and inflammation in conditions like rheumatoid arthritis, ankylosing spondylitis, and osteoarthritis. It may also be used to relieve muscle pain, back pain, toothache, or pain in the ear and throat.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93542, 2773, 1, 3, NULL, 'DICLOFENAC & PARACETAMOL  50 mg/325 mg Tablet should be taken with food. This will prevent you from getting an upset stomach. You should take it regularly as advised by your doctor. Do not take more or use it for a longer duration than recommended by your doctor.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
