(93561, 2835, 1, 2, NULL, 'ONDANSETRON 4mg Tablet is an antiemetic medicine commonly used to control nausea and vomiting due to certain medical conditions like stomach upset. It is also used to prevent nausea and vomiting caused due to any surgery, cancer drug therapy or radiotherapy.4mg Tablet is an antiemetic medicine commonly used to control nausea and vomiting due to certain medical conditions like stomach upset. It is also used to prevent nausea and vomiting caused due to any surgery, cancer drug therapy or radiotherapy.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93562, 2835, 1, 3, NULL, 'ONDANSETRON 4mg Tablet may be used alone or with other medications and can be taken with or without food. Your doctor will suggest the appropriate dose depending on what you are taking it for. The first dose is normally taken before the start of surgery, chemotherapy, or radiotherapy. After these treatments, take any further doses as prescribed by your doctor (normally only for a few days at most). Take it regularly at the same time(s) each day to get the most benefit. Be careful not to take too much.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
