(93583, 2898, 1, 1, NULL, 'The Product is recommended for use to treat the following:', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93584, 2898, 1, 2, NULL, 'ORNIDAZOLE & OFLOXACIN 200 mg/500 mg Tablet is a combination of two antibiotics that effectively kills the microorganisms. It is used to treat gynecological infections, lung infections, urinary infections, and gastrointestinal infections such as acute diarrhea or dysentery.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93585, 2898, 1, 3, NULL, 'ORNIDAZOLE & OFLOXACIN 200 mg/500 mg Tablet should be taken with food, but it must be taken at a fixed time to ensure better efficacy. Do not consume more than the recommended dose, as an overdose of it may have harmful effects on your body. If you miss a dose, take it as soon as you remember. The treatment must be completed even if you feel better to ensure a complete recovery.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93586, 2898, 2, 1, NULL, 'Please consult your doctor before consuming this medicine, in case of:', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93587, 2898, 2, 2, NULL, 'Before taking ofloxacin, tell your doctor or pharmacist if you are allergic to it; or to other quinolone antibiotics (such as ciprofloxacin, levofloxacin); or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems. Talk to your pharmacist for more details.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93588, 2898, 2, 3, NULL, 'This medication may make you more sensitive to the sun. Limit your time in the sun. Avoid tanning booths and sunlamps. Use sunscreen and wear protective clothing when outdoors. Tell your doctor right away if you get sunburned or have skin blisters/redness.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93589, 2898, 2, 4, NULL, 'Ofloxacin may cause a condition that affects the heart rhythm (QT prolongation). QT prolongation can rarely cause serious (rarely fatal) fast/irregular heartbeat and other symptoms (such as severe dizziness, fainting) that need medical attention right away.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93590, 2898, 2, 5, NULL, 'Low levels of potassium or magnesium in the blood may also increase your risk of QT prolongation. This risk may increase if you use certain drugs (such as diuretics/\"water pills\") or if you have conditions such as severe sweating, diarrhea, or vomiting. Talk to your doctor about using ofloxacin safely.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93591, 2898, 2, 6, NULL, 'This drug may make you dizzy. Alcohol or marijuana (cannabis) can make you more dizzy. Do not drive, use machinery, or do anything that needs alertness until you can do it safely. Limit alcoholic beverages. Talk to your doctor if you are using marijuana (cannabis).', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93592, 2898, 2, 7, NULL, 'Ofloxacin may cause live bacterial vaccines (such as typhoid vaccine) to not work as well. Do not have any immunizations/vaccinations while using this medication unless your doctor tells you to.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93593, 2898, 2, 8, NULL, 'Before having surgery, tell your doctor or dentist about all the products you use (including prescription drugs, nonprescription drugs, and herbal products).', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93594, 2898, 2, 9, NULL, 'Children may be more sensitive to the side effects of this drug, especially joint/tendon problems.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
(93595, 2898, 2, 10, NULL, 'During pregnancy, this medication should be used only when clearly needed. Discuss the risks and benefits with your doctor.', '2020-12-22 09:01:27', '2020-12-22 09:01:27'),
