(93829, 2900, 1, 2, NULL, 'NIMESULIDE & PARACETAMOL 100 mg/325 mg Tablet is a combination medicine which helps in relieving pain. It is used to relieve pain and inflammation in conditions like rheumatoid arthritis, ankylosing spondylitis, and osteoarthritis. It is also used to relieve fever, muscle pain, back pain, toothache, or pain in the ear and throat.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
(93830, 2900, 1, 3, NULL, 'NIMESULIDE & PARACETAMOL100 mg/325 mg Tablet should be taken with food. This will prevent you from getting an upset stomach. The dose will depend on what you are taking it for and how well it helps your symptoms. You should take it as advised by your doctor. Do not take more or use it for a longer duration than recommended by the doctor.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
