(93842, 2839, 1, 2, NULL, 'Ofloxacin 200mg Tablet is an antibiotic, used in the treatment of bacterial infections. It is also used in treating infections of the urinary tract, nose, throat, skin and soft tissues and lungs (pneumonia). It cures the infection by stopping the further growth of the causative microorganisms.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
(93843, 2839, 1, 3, NULL, 'Ofloxacin 200mg Tablet should be used in the dose and duration as advised by your doctor. It may be taken with or without food, preferably at a fixed time. Avoid skipping any doses and finish the full course of treatment even if you feel better. Do not take a double dose to make up for a missed dose. Simply take the next dose as planned.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
(93844, 2839, 2, 2, NULL, 'Do not take ofloxacin if you are pregnant, think you may be pregnant or are planning to have a baby. If you conceive while taking ofloxacin, stop taking it immediately and inform your doctor.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
(93845, 2839, 2, 3, NULL, 'Ofloxacin can pass into the breast milk and harm the child. Hence do not breast feed while you are on this medicine treatment.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
