(94055, 2754, 6, 2, NULL, 'Drug interactions may change how your medications work or increase your risk for serious side effects. This document does not contain all possible drug interactions. Keep a list of all the products you use (including prescription/nonprescription drugs and herbal products) and share it with your doctor and pharmacist. Do not start, stop, or change the dosage of any medicines without your doctor\'s approval.', '2020-12-22 09:01:28', '2020-12-22 09:01:28'),
