(94337, 2044, 6, 4, NULL, 'Special instructions need to be followed while taking this medicine along with Sex steroids such as oestriol, which is a female sex hormone. When Amoxycillin is taken by pregnant women, a decrease in the level of estrogens in the blood has been noted.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
