(94504, 2827, 1, 2, NULL, 'CETIRIZINE  10mg Tablet belongs to a group of medicines called antihistamines. It is used to treat various allergic conditions such as hay fever, conjunctivitis and some skin reactions, and reactions to bites and stings. It relieves watery eyes, runny nose, sneezing, and itching.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94505, 2827, 1, 3, NULL, 'CETIRIZINE  10mg Tablet can be taken with or without food. The dose required for you may vary depending on what you are taking it for. This medicine is usually taken in the evening but follow the advice of your doctor on how to take it. You may need this medicine only on days you have symptoms, but if you are taking it to prevent symptoms you should take it regularly. If you miss doses or stop taking it earlier than advised, your symptoms may come back.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
