(94613, 3309, 1, 2, NULL, 'Atropine Sulphate Injection is used to treat bradycardia(slow heart rate). It helps to restore normal heartbeat in cardiac arrest cases. This injection is also given before general anesthesia to reduce saliva secretions. It even works as an antidote to some insecticide poisoning.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94614, 3309, 1, 3, NULL, 'Atropine Sulphate Injection may be used in combination with other medicines to reverse the effect of muscle relaxants during surgery. It is given by your doctor or nurse, who will make sure you get the right amount. Let your doctor know about all other medications you are taking as some may affect, or be affected by this medicine.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94615, 3309, 2, 2, NULL, 'When the recurrent use of atropine is essential in patients with coronary artery disease, the total dose should be restricted to 2 to 3 mg (maximum 0.03 to 0.04 mg/kg) to avoid the detrimental effects of atropine-induced tachycardia on myocardial oxygen demand.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94616, 3309, 2, 3, NULL, 'Acute Glaucoma : Atropine may precipitate acute glaucoma.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94617, 3309, 2, 4, NULL, 'Pyloric Obstruction : Atropine may convert partial organic pyloric stenosis into complete obstruction.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94618, 3309, 2, 5, NULL, 'Complete Urinary Retention : Atropine may lead to complete urinary retention in patients with prostatic hypertrophy.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94619, 3309, 2, 6, NULL, 'Viscid Plugs : Atropine may cause inspissation of bronchial secretions and formation of viscid plugs in patients with chronic lung disease.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94620, 3309, 6, 2, NULL, 'Atropine Sulfate Injection decreased the rate of mexiletine absorption without altering the relative oral bioavailability; this delay in mexiletine absorption was reversed by the combination of atropine and intravenous metoclopramide during pretreatment for anesthesia.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94621, 3309, 6, 3, NULL, 'Pregnancy : Animal reproduction studies have not been conducted with atropine. It also is not known whether atropine can cause fetal harm when given to a pregnant woman or can affect reproduction capacity.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94622, 3309, 6, 4, NULL, 'Nursing Mothers : Trace amounts of atropine was found in breast milk. The clinical impact of this is not known.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94623, 3309, 6, 5, NULL, 'Pediatric Use : Recommendations for use in pediatric patients are not based on clinical trials.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94624, 3309, 6, 6, NULL, 'Geriatric Use : An evaluation of current literature revealed no clinical experience identifying differences in response between elderly and younger patients. In general, dose selection for an elderly patient should be cautious, usually starting at the low end of the dosing range, reflecting the greater frequency of decreased hepatic, renal, or cardiac function, and of concomitant disease or other drug therapy.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94625, 3309, 5, 1, NULL, 'Most of the side effects of atropine are directly related to its antimuscarinic action. Dryness of the mouth, blurred vision, photophobia and tachycardia commonly occur. Anhidrosis can produce heat intolerance. Constipation and difficulty in micturition may occur in elderly patients. Occasional hypersensitivity reactions have been observed, especially skin rashes which in some instances progressed to exfoliation', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94626, 2780, 2, 2, NULL, 'You have any other types of allergies, such as to foods, dyes, preservatives, or animals.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
(94627, 2780, 2, 3, NULL, 'You are pregnant or breastfeeding. This is because, while you are expecting or feeding a baby, you should only take medicines on the recommendation of a doctor.', '2020-12-22 09:01:29', '2020-12-22 09:01:29'),
